// pokemon-collection-frontend/src/app/app-routing.module.ts
import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { CollectionComponent } from './collection/collection.component';

const routes: Routes = [
  { path: '', component: CollectionComponent },  // Set the root path to load CollectionComponent
  { path: '**', redirectTo: '', pathMatch: 'full' } // Redirect any unknown paths to the root
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule {}
